sys_variable_value.value:
var aGroup = current.getValue('assignment_group');
var date = current.variables.date.toString();
var slot = current.variables.time_slot.toString();
var sameSlot;

var grMembers = new GlideRecord('sys_user_grmember');
grMembers.addQuery('group', aGroup);
grMembers.query();

while(grMembers.next()) {
	sameSlot = false;
	var ritm = new GlideRecord('sc_req_item');
	ritm.addActiveQuery();
	ritm.addQuery('cat_item', '3da142b8db589010fec729e1ca9619f9');
	ritm.addQuery('assigned_to', grMembers.getValue('user'));
	ritm.query();
	while(ritm.next()) {
		if(ritm.variables.date.toString() == date && ritm.variables.time_slot.toString() == slot) {
			sameSlot = true;
			break;
		}
	}
	if(sameSlot == false) {
		//We can assign to the current user
		current.assigned_to = grMembers.getValue('user');
		break;
	}
}

